import React from 'react';
import './App.css';

function App() {
  return (
    <div>
      <BrowserRouter>

        <div style={{ backgroundColor: '#999999' }}>
          <Header
          />
          <Content
            ref='contentLayer'
            callLogoutButton={this.callLogoutButton}
          />
          <hr className="hr2" />
          <Footer />
        </div>

      </BrowserRouter>
    </div>
  );
}

export default App;
